      cvt = [RAREPlatform getDataConverterWithIOSClass:[IOSClass classWithClass:[RAREDateConverter class]]];
      return [((id<RAREiDataConverter>) nil_chk(cvt)) objectFromStringWithRAREiWidget:widget withNSString:value withId:(context == nil) ? [((id<RAREiPlatformAppContext>) nil_chk(app)) getDefaultDateContext] : context];
      case RARERenderableDataItem_TYPE_DATETIME:
