      case RARERenderableDataItem_TYPE_ARRAY:
      return [IOSObjectArray arrayWithObjects:(id[]){ value } count:1 type:[IOSClass classWithClass:[NSString class]]];
      case RARERenderableDataItem_TYPE_BOOLEAN:
      return [JavaLangBoolean valueOfWithBoolean:[RAREUTSNumber booleanValueWithNSString:value]];
      case RARERenderableDataItem_TYPE_WIDGET:
